import React from 'react';
import Form from './Form';
import './index.css'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import FormSubmitted from './FormSubmitted';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Define routes */}
        <Routes>
          <Route exact path="/" component={Form} /> {/* Render Form component for '/' route */}
          <Route path="/form-submitted" component={FormSubmitted} /> {/* Render FormSubmitted component for '/form-submitted' route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
